import React from "react";
import {Link} from "react-router-dom";
import SecondNavBar from "./SecondNavBar";

const AdminDashboardNavBar = () => {
    return(
        <div>
            <SecondNavBar />
            <nav>
                <ul className="uldash">
                    <Link className="dashnav dashnav1" to="/admindashboardhome"><li>Order</li></Link>
                    <Link className="dashnav dashnav2" to="/admindashboardpending"><li>Pending</li></Link>
                    <Link className="dashnav dashnav3" to="/admindashboarddeliveries"><li>Deliveries</li></Link>
                </ul>
            </nav>
        </div>
    )
}

export default AdminDashboardNavBar;
